import React, { useState } from "react";
import MapContainer2 from "./MapContainer2";
import {
  Container,
  Box,
  Button,
  Grid,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Radio,
  FormLabel,
} from "@material-ui/core";
import { green } from "@material-ui/core/colors";
import { withStyles } from "@material-ui/core/styles";

const SearchHealingPlace = () => {
  const [place, setPlace] = useState("공원");
  const [selected, setSelected] = useState("공원");
  const onChange = (e) => {
    setPlace(e.target.value);
    setSelected(e.target.value);
  };
  const GreenRadio = withStyles({
    root: {
      color: green[400],
      "&$checked": {
        color: green[600],
      },
    },
    checked: {},
  })((props) => <Radio color="default" {...props} />);

  return (
    <>
      <MapContainer2 searchPlace={place} />
      <FormControl component="fieldset">
        <GreenRadio row aria-label="position" name="searchKeyword1">
          <FormControlLabel
            value="공원"
            control={<Radio color="green" />}
            label="공원"
            onChange={onChange}
            checked={selected == "공원"}
          />
          <FormControlLabel
            value="맛집"
            control={<Radio color="primary" />}
            label="맛집"
            onChange={onChange}
            checked={selected == "맛집"}
          />
          <FormControlLabel
            value="카페"
            control={<Radio color="primary" />}
            label="카페"
            onChange={onChange}
            checked={selected == "카페"}
          />
          <FormControlLabel
            value="도서관"
            control={<Radio color="primary" />}
            label="도서관"
            onChange={onChange}
            checked={selected == "도서관"}
          />
          <FormControlLabel
            value="휴양림"
            control={<Radio color="primary" />}
            label="휴양림"
            onChange={onChange}
            checked={selected == "휴양림"}
          />
        </GreenRadio>
      </FormControl>
      {/* <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="공원"
        checked={selected == "공원"}
      />
      공원
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="맛집"
        checked={selected == "맛집"}
      />
      맛집
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="카페"
        checked={selected == "카페"}
      />
      카페
      <input
        type="radio"
        name="searchKeyword2"
        onChange={onChange}
        value="도서관"
        checked={selected == "도서관"}
      />
      도서관 */}
    </>
  );
};

export default SearchHealingPlace;
